import React from "react";
import Typography from '@mui/material/Typography';



const Dashboard = () => {
  return (
    <Autocomplete
    disablePortal
    id="combo-box-demo"
    options={"top100Films"}
    sx={{ width: 300 }}
    renderInput={(params) => <TextField {...params} label="Movie" />}
  />
  );
};

export default Dashboard;
